import React from "react";
import componentStyle from "./index.module.css";

export default class WireTypeChoosing extends React.Component {
  render() {
    return (
      <div
        className={componentStyle["container"]}
        style={{
          backgroundColor: this.props.showNext
            ? "rgba(0, 240, 112, 0.5)"
            : "rgba(0, 240, 112, 0)",
        }}
      >
        <div
          className={`${componentStyle["single-core"]} ${componentStyle["core-type"]}`}
        ></div>
        <div
          className={`${componentStyle["double-core"]} ${componentStyle["core-type"]}`}
        ></div>
      </div>
    );
  }
}
